import React from "react";
import Note from "./components/Note";

const App = ({ notes }) => {
  const renderNotes = () => {
    return notes.map(note => <li key={note.id}>{note.content}</li>);
  };

  return (
    <div className="App">
      <ul>{renderNotes()}</ul>
    </div>
  );
};

export default App;
